package pattern;

public class pattern {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
	
		
			
		int a=10,b=20,c=5;
		System.out.println(a<b);
		System.out.println(b>c);
		System.out.println((a>b) && (a>c));
		System.out.println((a>b) || (a>c));
		System.out.println(!(a>b) || (a>c));
		}
		
		
		
		

}
